import React, { useState, useEffect } from "react";
import axios from "axios";

export const FrameWrapper = () => {
  const [labs, setLabs] = useState([]);

  useEffect(() => {
    const fetchLabs = async () => {
      try {
        const response = await axios.get("http://0.0.0.0:8080/api/labs");
        console.log(response.data);  // Log the response to check the structure
        if (Array.isArray(response.data)) {
          setLabs(response.data);  // Only set labs if it's an array
        } else {
          console.error("Expected an array but got:", response.data);
        }
      } catch (error) {
        console.error("Error fetching lab data", error);
      }
    };

    fetchLabs();
  }, []);

  return (
    <div className="inline-flex flex-col items-start gap-5">
      {additional_location.length === 0 ? (
        <div>Loading Data...</div>
      ) : (
        labs.map((lab) => (
          <div key={lab.user_id} className="flex flex-col gap-5">
            {/* Additional Locations */}
            <div className="relative w-[1067px] h-[480px] bg-white rounded-3xl border border-solid border-[#cbcbcb]">
              <div className="flex flex-col w-[1028px] items-start absolute top-[135px] left-[19px] rounded-3xl">
                <div className="absolute top-[18px] left-[19px] font-extrabold text-[#e93a3a] text-xl tracking-[-0.12px] [font-family:'Nunito_Sans',Helvetica]">
                  Additional Locations
                </div>

                <img
                  className="absolute w-[1028px] h-px top-[52px] left-[19px]"
                  alt="Line"
                  src="https://c.animaapp.com/ma1zul3fdSvUQH/img/line-3.svg"
                />

                <div className="flex items-center relative self-stretch w-full">
                  <div className="grid grid-cols-4 w-full">
                    {['Country', 'State', 'City', 'Details'].map((header, index) => (
                      <div key={index} className="flex h-[54px] items-center px-[18px] py-3 border-[0.5px] border-solid border-[#cbcbcb]">
                        <div className="font-bold text-[#242424] text-base">
                          {header}
                        </div>
                      </div>
                    ))}
                  </div>
                </div>

                {lab.profile_menu?.additional_location.map((location, index) => (
                  <div key={index} className="flex items-center relative self-stretch w-full">
                    <div className="grid grid-cols-4 w-full">
                      <div className="flex h-[54px] items-center px-[18px] py-3 border-[0.5px] border-solid border-[#cbcbcb]">
                        <div className="font-medium text-[#474747] text-sm">
                          {location.country}
                        </div>
                      </div>
                      <div className="flex h-[54px] items-center px-[18px] py-3 border-[0.5px] border-solid border-[#cbcbcb]">
                        <div className="font-medium text-[#474747] text-sm">
                          {location.state}
                        </div>
                      </div>
                      <div className="flex h-[54px] items-center px-[18px] py-3 border-[0.5px] border-solid border-[#cbcbcb]">
                        <div className="font-medium text-[#474747] text-sm">
                          {location.city}
                        </div>
                      </div>
                      <div className="flex h-[54px] items-center px-[18px] py-3 border-[0.5px] border-solid border-[#cbcbcb]">
                        <div className="font-medium text-[#474747] text-sm">
                          DETAILS
                        </div>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            {/* Test Lab Capabilities Section */}
            <div className="w-[1067px] bg-white rounded-3xl border border-solid border-[#cccccccc] p-5">
              {Object.entries(lab.profile_menu?.test_lab_capabilities || {}).map(([key, value]) => (
                <div key={key} className="mb-4">
                  <div className="font-bold text-lg mb-2">{key.replace(/_/g, ' ')}</div>
                  <div className="inline-flex items-center gap-1.5 px-3 py-2 rounded-3xl border border-solid border-[#cccccccc]">
                    <div className="font-medium text-[#474747] text-sm">
                      {Array.isArray(value) ? value.join(", ") : value}
                    </div>
                  </div>
                </div>
              ))}
            </div>

            {/* Testing Standards Section */}
            <div className="w-[1067px] bg-white rounded-3xl border border-solid border-[#cccccccc] p-5">
              <h2 className="font-extrabold text-[#e93a3a] text-xl mb-4">Testing Standards Supported</h2>
              {Object.entries(lab.profile_menu?.testing_standards_supported || {}).map(([key, value]) => (
                <div key={key} className="mb-4">
                  <div className="font-bold text-lg mb-2">{key.replace(/_/g, ' ')}</div>
                  <div className="inline-flex items-center gap-1.5 px-6 py-2 rounded-3xl border border-solid border-[#cccccccc]">
                    <div className="font-medium text-[#474747] text-sm">
                      {Array.isArray(value) ? value.join(", ") : value}
                    </div>
                  </div>
                </div>
              ))}
            </div>

            {/* Social Links Section */}
            <div className="w-[1067px] bg-white rounded-3xl border border-solid border-[#cccccccc] p-5">
              <h2 className="font-extrabold text-[#e93a3a] text-xl mb-4">Social Links</h2>
              <div className="flex gap-3">
                {lab.profile_menu?.social_links?.map((link, index) => (
                  <a
                    key={index}
                    href={`https://www.${link}.com`}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="flex items-center gap-2 px-4 py-2 rounded-[25px] border border-solid border-[#dddddd]"
                  >
                    <img
                      className="w-6 h-6"
                      alt={link}
                      src={`https://c.animaapp.com/ma1zul3fdSvUQH/img/uit-${link}-alt.svg`}
                    />
                    <span className="font-medium text-[#6161ff] text-sm">
                      {link.charAt(0).toUpperCase() + link.slice(1)}
                    </span>
                  </a>
                ))}
              </div>
            </div>
          </div>
        ))
      )}
    </div>
  );
};
